import React from 'react'
import { ReactComponent } from 'Assets/excel.svg'
import Icon from '@ant-design/icons'


const ExcelIcon: React.FC = () => {
  return (
    <Icon component={ReactComponent} style={{ fontSize: 18 }} />
  )
}

export default ExcelIcon
